import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';

import ProfilePage from './pages/ProfilePage';
import InvestorPage from './pages/InvestorPage';
import StartupPage from './pages/StartupPage';
import AllStartupsPage from './pages/AllStartupsPage';
import AllInvestorsPage from './pages/AllInvestorsPage';
import React from 'react';
import './index.css';
import BlogPage from './pages/BlogPage';
import AllBlogsPage from './pages/AllBlogsPage';
import { AuthContext } from '../context/AuthContext';




function App() {
  const { user } = useContext(AuthContext);
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />

        <Route path="/profile" element={<ProfilePage />} />
        <Route path="/investor" element={<InvestorPage />} />
        <Route path="/AllInvestors" element={<AllInvestorsPage />} />
        <Route path="/startup" element={<StartupPage />} />
        <Route path="/AllStartups" element={<AllStartupsPage />} />
        <Route path="/blog" element={<BlogPage />} />
        <Route path="/AllBlogs" element={<AllBlogsPage />} />


      </Routes>
    </Router>
  );
}

export default App;
